class Room{constructor(n,t,i){this.id=n;this.creatorId=t;this.currentUserId=i}}class Error{constructor(n,t){this.caption=n;this.message=t}}window.ZokuChat.chat={};window.ZokuChat.chat.room=null;window.ZokuChat.chat.connection=(new signalR.HubConnectionBuilder).withUrl("/chatHub").build();window.ZokuChat.chat.connection.on("ReceiveMessages",function(n){n.forEach(function(n){window.ZokuChat.chat.app.messages.push(n)})});window.ZokuChat.chat.connection.on("ReceiveMessage",function(n){window.ZokuChat.chat.app.messages.push(n)});window.ZokuChat.chat.connection.on("ReceiveError",function(n,t){window.ZokuChat.chat.app.errors.push(n,t)});window.ZokuChat.chat.app=new Vue({el:"#chat-app",data:{window:window,messages:[],errors:[]},methods:{startHub:function(){window.ZokuChat.chat.connection.start().catch(function(n){return console.error(n.toString())}).then(function(){window.ZokuChat.chat.app.joinRoom().then(function(){window.ZokuChat.chat.app.retrieveMessages()})})},joinRoom:function(){return window.ZokuChat.chat.connection.invoke("JoinRoom",window.ZokuChat.chat.room.id).catch(function(n){return console.error(n.toString())})},retrieveMessages:function(){return window.ZokuChat.chat.connection.invoke("GetMessages",window.ZokuChat.chat.room.id).catch(function(n){return console.error(n.toString())})},sendMessage:function(n){return window.ZokuChat.chat.connection.invoke("SendMessage",window.ZokuChat.chat.room.id,n).catch(function(n){return console.error(n.toString())})}}});